for the first two cases, there is only one way to place another piece to cover the lower left corner. in the last case, there is no way to place another piece to cover the lower left corner without overlapping the first piece. in both of the first two cases, the two leftmost columns will be covered. so, we can use this logic again, on the top left square which has not yet been covered. we have two choices of how to cover the first two columns, two choices of how to cover the next two columns, and two choices of how to cover the last two columns, so there are $2\cdot2\cdot2=\boxed{8}$ total ways to cover the entire board.

